import React from 'react';
import Home from './Pages/Home';
import {Router, Route, BrowserRouter, IndexRoute} from 'react-router';
import './App.css';

function App() {
  return (
  	<BrowserRouter>
  		<div>
  			<Route path={'/'} component={Home}>
    		</Route>
    	</div>
    </BrowserRouter>
  );
}

export default App;
